	"containerfield": {
		"ContainerFieldComponent.html": "<ext-container layout=\"vbox\" padding=\"10\" maxWidth=\"660\">\n  <ext-panel\n    ui=\"instructions\"\n    margin=\"0 0 20 0\"\n    shadow=\"true\"\n  >\n    <div>\n      <b>ContainerField</b> allows you to apply a single label to multiple fields.This is especially useful for groups of checkboxes, radio buttons, and other compound fields.\n    </div>\n  </ext-panel>\n  <ext-formpanel\n    maxWidth=\"660\"\n    layout=\"form\"\n    shadow=\"true\"\n    defaults='{\"labelAlign\": \"left\", \"labelTextAlign\": \"right\"}'>\n    <ext-containerfield\n      label=\"Name\"\n      onready=\"containerfield.containerFieldComponentReady\"\n      defaults='{\"labelAlign\": \"bottom\"}'>\n      <ext-textfield label=\"First\"></ext-textfield>\n      <ext-textfield label=\"Middle\"></ext-textfield>\n      <ext-textfield label=\"Last\"></ext-textfield>\n    </ext-containerfield>\n    <ext-containerfield\n      label=\"Vehicle Class\"\n      layout='{\"type\": \"vbox\", \"align\": \"left\"}'\n      defaults='{ \"margin\": \"0\" }'>\n      <ext-radiofield boxLabel=\"Compact\" name=\"priority\"></ext-radiofield>\n      <ext-radiofield boxLabel=\"Mid-size\" name=\"priority\"></ext-radiofield>\n      <ext-radioField boxLabel=\"SUV\" name=\"priority\"></ext-radioField>\n    </ext-containerfield>\n    <ext-containerfield\n      label=\"Options\"\n      layout='{\"type\": \"vbox\", \"align\": \"left\"}'\n    >\n      <ext-checkboxfield boxLabel=\"A/C\"></ext-checkboxfield>\n      <ext-checkboxfield boxLabel=\"Leather\"></ext-checkboxfield>\n      <ext-checkboxfield boxLabel=\"Nav\"></ext-checkboxfield>\n    </ext-containerfield>\n  </ext-formpanel>\n</ext-container>\n",
		"ContainerFieldComponent.js": "import './ContainerFieldComponent.html';\n\nexport default class ContainerFieldComponent {\n    containerFieldComponentReady = (event) => {\n        const isPhone = Ext.os.is.Phone;\n        this.containerFieldCmp = event.detail.cmp;\n        const layout = isPhone ? 'vbox' : 'hbox';\n        this.containerFieldCmp.setLayout(layout);\n    }\n}\n"
	},
