	"timefield": {
		"TimeFieldComponent.html": "<ext-formpanel\n  layout='{\"type\": \"vbox\", \"align\": \"stretch\"}'\n  width=\"300\"\n  height=\"300\"\n  bodyPadding=\"10\"\n  shadow=\"true\"\n>\n  <ext-fieldset\n    title=\"Personal Info\"\n    defaults='{\"labelAlign\": \"placeholder\"}'\n  >\n    <ext-timefield\n      required=\"true\"\n      label=\"Time Field\"\n      value=\"3:42 PM\"\n      name=\"time\"\n      onready=\"timefield.timeFieldReady\"\n    >\n    </ext-timefield>\n  </ext-fieldset>\n  <ext-toolbar\n    shadow=\"false\"\n    docked=\"bottom\"\n    layout='{ \"type\": \"hbox\", \"pack\": \"right\" }'\n  >\n    <ext-button\n      onready=\"timefield.buttonReady\"\n      text=\"Disable All\"\n      margin=\"0 10 0 0\"\n      onTap=\"timefield.toggleDisable\"\n    >\n    </ext-button>\n    <ext-button\n      text=\"Reset\"\n      onTap=\"timefield.resetTimeField\"\n    >\n    </ext-button>\n  </ext-toolbar>\n</ext-formpanel>\n",
		"TimeFieldComponent.js": "import './TimeFieldComponent.html';\nExt.require('Ext.field.InputMask'); // need to require this specifically for inputMask props to work\n\nexport default class TimeFieldComponent {\n    constructor() {\n        this.disabled = false;\n    }\n\n    toggleDisable = () => {\n        this.disabled = !this.disabled;\n        let buttonText = 'Disable All';\n\n        if (this.disabled) {\n            buttonText = 'Enable All';\n        }\n\n        this.buttonCmp.setText(buttonText);\n        this.timefieldCmp.setDisabled(this.disabled);\n    }\n\n    timeFieldReady = (event) => {\n        this.timefieldCmp = event.detail.cmp;\n    }\n\n    buttonReady = (event) => {\n        this.buttonCmp = event.detail.cmp;\n    }\n\n    resetTimeField = () => {\n        this.timefieldCmp.reset(true);\n    }\n}\n"
	},
